import React from "react";
import Card from "./Card";
import Sdata from "./Sdata"


// import "./index.css";
function App() {
        <>
            <h1 className=" text-center m-5 " >This Is Official Netflix Site</h1>

            {Sdata.map((val, index) => {
                return (
                    <Card
                        imgsrc={val.imgsrc}
                        title={val.title}
                        sname={val.sname}
                        Link={val.Link}
                    />
                )
            })}
        </>


}

export default App;
